import React, {useState, useEffect, Fragment} from 'react';
import {BrowserRouter as Router, Route, Switch, Link} from 'react-router-dom';
import Products from "./pages/product/Products";
import ProductView from "./pages/product/ProductView";
import Navbar from "./components/nav";
import logo from './logo.svg';
import {addToCart, removeFromCart, subscribeToCartChanges} from "./components/product/CartUtil";

function App(props) {
  console.log("App#props: ", props);

  return (
    <section className="section">
      <div className="container">
        <Router>
          <Navbar/>
          <Switch>
            <Route exact={true} path="/"
              render={()=>(
                <div className="has-text-centered">
                  <Link to="/products" className="button is-danger is-large
                    is-uppercase is-family-monospace">
                    Enter
                  </Link>
                </div>
              )}/>
            <Route exact={true} path="/products" components={Products}/>
            <Route exact={true} path="/product/:id" components={ProductView}/>
          </Switch>
        </Router>
      </div>
    </section>
  );
}

export default App;
